How to pass more than one criteria to Criteria.elemMatch() Api?<p>I have a situation that I want to provide 3 conditions in <code>elemMatch</code> method call provided by <code>org.springframework.data.mongodb.core.query.Criteria</code> Api.</p>

<p><code>Inventory</code> collection looks like this -</p>

<pre><code>{
    "_id" : "H-P3NCDST45"
    "booking" : [
    {
        "updateDate" : ISODate("2018-01-29T13:32:03.789Z"),
        "status" : "STARTED",
        "message" : "abc"
    },
    {
        "updateDate" : ISODate("2018-01-29T13:32:04.789Z"),
        "status" : "PENDING",
        "message" : "def"
    },
    {
        "updateDate" : ISODate("2018-01-29T13:33:04.789Z"),
        "status" : "CONFIRMED",
        "message" : "abc"
    }
]
}
</code></pre>

<p>I want to do something like below query. Fetch all documents from <code>inventory</code> collection which have at-least one embedded document in <code>booking</code> array whose status is "STARTED" and <code>updateDate</code> is between <code>&lt;start&gt;</code> and <code>&lt;end&gt;</code> date, i.e. Fetch all booking from inventory which are started/initiated between given <code>&lt;start&gt;</code> and <code>&lt;end&gt;</code> date.</p>

<pre><code>db.inventory.find({"booking": { $elemMatch: { status: "STARTED",updateDate: { $gte: ISODate("2018-01-01T14:04:34.447Z"), $lte: ISODate("2018-01-20T14:04:34.447Z")}}}})
</code></pre>

<p>Criteria Api provides <code>criteria.elemMatch(Criteria c)</code>. <strong>How to pass multiple criteria in this <code>elemMatch(c)</code> method call?</strong></p>

