<p>for each element in rois array i have an array of history values with a [date,number] tuple. how can i order the history array by its Date first element?</p>; Answer: @Engine Couple of observations.  The first is there are two branches on the interval x in [-pi, pi] so you probably are better served looking on the range [0, pi] instead.  The other, is you're finding zeros of sinc(x)-y0 given some value of y0 on the interval [0, 1].  Zeros for sinc(x)-y0 where y0=0 is trivially pi.

embedfield:
NodeJS/ES6: Cannot set property of undefined<p>Using NodeJS/ES6 I have created a MongoDB connector class.</p>

<pre><code>class DBClient {

    constructor(host, port) {
        this.host = host;
        this.port = port
        this.dbConnection = null;
    }

    buildConnectionString() {
        return 'mongodb://' + this.host + ':' + this.port;
    }

    connect() {
        var connectionString = this.buildConnectionString();
        console.log('[MongoDB] - Connecting to instance @ ' + connectionString);
        var DBConnection = MongoClient.connect(connectionString, function(error, db) {
            if (error) {
                console.log('[MongoDB] - Error connecting to instance');
                console.log(error);
            }
            else {
                console.log('[MongoDB] - Connection Successful');
                this.dbConnection = db;
            }
        });
    }
}
</code></pre>

<p>Which is then being created in a different file like so</p>

<pre><code>var client = new DBClient('127.0.0.1', '1337');
client.connect();
</code></pre>

<p>When the database is connected to, NodeJS crashes when it reaches <code>this.dbConnection = db;</code>, stating <code>TypeError: Cannot set property 'dbConnection' of undefined</code>.</p>

<p>I'm pretty sure it has something to do with being used in a callback, which is screwing up the scope. How can I get around this though? Wouldn't any operation from the callback scope be isolated and unable to reference <code>this</code>?</p>

<p>Also, as a side question, is this a bad code practice to initialize a null property like I'm doing in the constructor? If so, what would be a more proper way of doing it?</p>

