Meteor mocha test subscriptions<p>I'm currently working on writing client-side tests for my application using <code>practicalmeteor:mocha</code>. Therefor I need to insert a record into a mongo collection before every step.</p>

<p>Following the concepts of meteor, I wrote some meteor methods to insert/update/delete the records. If I want to test the expected behaviour, I assume I have to call the appropiate method <em>(to insert a record for example)</em> and then have to wait for the subscription to synchronize the record to the client so I can verify the insert.</p>

<p>I tried a few things but none of them seems to work:</p>

<pre><code>describe('a topic', function() {
    beforeEach(async function(done) {
        let res = await new Promise((resolve, reject) =&gt; {
            Meteor.call('topics.createNew', function(err, res) {
                if(err) return reject(err);
                resolve(res); //res is the _id from the generated record
            });
        });

        //subscribe to single record (the one just created)
        let subscription = Meteor.subscribe('topics.details', res); 

        //i assume this runs every time the publish function calls ready and therefor is also run when the new record is published
        Tracker.autorun((computation) =&gt; {
            let count = TopicsCollection.find({}).count();
            //console.log('topic count: ' + count);                

            if(subscription.ready() &amp;&amp; count === 1) {
                computation.stop();
                done();
            }
        });
    });
});
</code></pre>

<p>I logged the counted documents and had luck when i wrapped the autorun-Funktion into a Promise but in neither of both cases, <code>done()</code> was called causing a timeout in mocha.</p>

<p>I already had a look on <a href="https://stackoverflow.com/questions/29967248/mocha-test-is-not-waiting-for-publication-subscription">this question</a> but I think it doesnt really help in my situation since I wait for every possible callback and I'm working with a plain Collection and the guy in the question above uses an accounts-package.</p>

<p>Can anyone suggest a better/working solution for this problem?<br>
Thanks in advance! :D </p>

