best way to execute query in mongodb(3.0 drivers) and nodejs<p><strong>db.js</strong> </p>

<pre><code>  var mongodb = require('mongodb').MongoClient;
  var settings = require("./settings.js");
  var ObjectId = require('mongodb').ObjectID;
  var db = {
    selectData: function(collection, query, callback, project = false) {
      mongodb.connect(settings.db_url, function(err, client) {
        var database = client.db(settings.db_name);
        if (err) throw err;
        if (project !== false) {
          console.log("Project is not false");
          console.log( project);
          database.collection(collection).find(query, project).toArray(function(err, result) {
            client.close();
            if (err) throw err;
            callback(result);
          });
        } else {
          database.collection(collection).find(query).toArray(function(err, result) {
            client.close();
            if (err) throw err;
            callback(result);
          });
        }
      });
    }
  }


  module.exports = db;
</code></pre>

<p><strong>server.js</strong></p>

<p>here is a simple query with single database call takes few seconds not a big deal but still not good method as per experts.</p>

<pre><code>var db = require("db.js");
db.selectData("testCollection",{},function(data){
console.log(data);
});
</code></pre>

<p>Now here is a multi query nested database calls which takes more time and really bad for performance and speed</p>

<pre><code> var db = require("db.js");
    db.selectData("testCollection", {}, function(data) {
      db.selectData("testCollection", {}, function(data) {
        db.selectData("testCollection", {}, function(data) {
          db.selectData("testCollection", {}, function(data) {
            db.selectData("testCollection", {}, function(data) {
              console.log(data);
            });
          });
        });
      });
    });
</code></pre>

<p>What i want is open connection once and use db object outside without connecting again and again for each request or nested querys for fast response </p>

<p>i also know that with <strong>mongodb nodejs 2.3 drivers</strong> its possible and i have tested it perfectly working but i am looking for solution how to do same with <strong>mongodb nodejs 3.0 drivers</strong> </p>

<p>in short i am looking for a method where i can connect once and execute querys faster  for chat and real time applications  and performance optimizations </p>

<p>thank you.</p>

